import React, { useState } from "react";
import { Link } from "react-router-dom";
import logo from "../images/logo.png";

const Navbar = () => {
  // Use state to track the user's authentication status
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Simulate a user being logged in (you should replace this with actual authentication logic)
  // You can set isLoggedIn to true when the user logs in
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <nav
      className="navbar navbar-expand-lg navbar-dark"
      style={{ background: "#50C878" }}
    >
      <div
        className="container"
        style={{ color: "black", fontFamily: "Barlow", fontWeight: "Bold" }}
      >
        <Link className="navbar-brand" to="/">
          <img
            src={logo}
            alt="Logo"
            style={{ height: "auto", width: "100px" }}
          />
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div
          className="collapse navbar-collapse justify-content-end"
          id="navbarNav"
        >
          <ul className="navbar-nav">
            {/* ... other menu items ... */}
            <li className="nav-item dropdown">
              <Link
                className="nav-link dropdown-toggle"
                to="/"
                id="accountDropdown"
                role="button"
                data-bs-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"
              >
                Account
              </Link>
              <div className="dropdown-menu" aria-labelledby="accountDropdown">
                {/* Conditionally display the login/register options if not logged in */}
                {!isLoggedIn && (
                  <>
                    <Link className="dropdown-item" to="/login">
                      Login
                    </Link>
                    <Link className="dropdown-item" to="/register">
                      Register
                    </Link>
                  </>
                )}
                {/* Always display the profile option */}
                <Link className="dropdown-item" to="/profile">
                  Profile
                </Link>
              </div>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
